import React from "react";
import { useNavigate } from "react-router";

import './css/styles.css';

import Card from "react-bootstrap/Card"

export default function Dashboard() {

    const navigate = useNavigate();

    const handleClickCreate = () => {
        navigate("/create");
    }

    const handleClickLookup = () => {
        navigate("/lookup");
    }



    return (
        <div className="dashboard">
            <h3>Hello! How can we help?</h3>
            <h4>You can create a new ticket, or look up an existing ticket using your email.</h4>
            <br />
            <Card>
                <Card.Img variant="top">
                </Card.Img>
                <Card.Body>
                    <button className="btn btn-primary" onClick={handleClickCreate}>Create Ticket</button>
                </Card.Body>
            </Card>

            <Card>
                <Card.Img variant="top">
                </Card.Img>
                <Card.Body>
                    <button className="btn btn-secondary" onClick={handleClickLookup}>Lookup Ticket</button>
                </Card.Body>
            </Card>


        </div>
    );

}
